import{_ as o,o as s,c as a,z as e,a as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 8.01-130.6 On what goods levied; to what extent goods liable; priorities between landlord and other lienors.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-130.6.md","filePath":"vacode/8.01-130.6.md"}'),r={name:"vacode/8.01-130.6.md"},i=e("h1",{id:"§-8-01-130-6-on-what-goods-levied-to-what-extent-goods-liable-priorities-between-landlord-and-other-lienors",tabindex:"-1"},[t("§ 8.01-130.6 On what goods levied; to what extent goods liable; priorities between landlord and other lienors. "),e("a",{class:"header-anchor",href:"#§-8-01-130-6-on-what-goods-levied-to-what-extent-goods-liable-priorities-between-landlord-and-other-lienors","aria-label":'Permalink to "§ 8.01-130.6 On what goods levied; to what extent goods liable; priorities between landlord and other lienors."'},"​")],-1),n=e("p",null,"The distress may be levied on any goods of the lessee, his assignee, or any sublessee that are found on the premises or that may have been removed from the premises not more than 30 days prior to the levy. A levy within such 30 days shall have like effect as if the goods levied on had not been removed from the leased premises. If the goods of such lessee, assignee, or sublessee, when carried on the premises, are subject to a lien that is valid against his creditors, his interest only in such goods shall be liable to such distress. If any lien is created on such goods while they are upon the leased premises, or within 30 days after such lien is created, they are liable to distress, but for not more than six months' rent if the premises are used for residential purposes, and not for farming or agriculture, and for not more than 12 months' rent if the lands or premises are used for farming or agriculture, whether such rent has accrued before or after the creation of the lien. No other goods shall be liable to distress than such as are declared to be so liable in this section, nor shall the goods of the sublessee be liable to a greater amount than such sublessee owed the tenant at the time the distress was levied.",-1),l=e("p",null,[t("Code 1919, § 5523; 1922, p. 863; 1932, p. 696; Code 1950, § 55-231; 2019, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712",target:"_blank",rel:"noreferrer"},"712"),t(".")],-1),d=[i,n,l];function h(c,f,u,b,p,m){return s(),a("div",null,d)}const v=o(r,[["render",h]]);export{_ as __pageData,v as default};
